     */
    public function setDepartureFlightIndex($departureFlightIndex)
    {
        $this->container['departureFlightIndex'] = $departureFlightIndex;

        return $this;
    }

    /**
     * Gets arrivalFlightIndex.
     *
     * @return int
     */
    public function getArrivalFlightIndex()
    {
        return $this->container['arrivalFlightIndex'];
    }

    /**
     * Sets arrivalFlightIndex.
     *
     * @param int $arrivalFlightIndex Index of the arriving flight in the leg for which this alert was generated. (zero-based, applicable to Arrival Delay and Departure And Arrival Delay waivers)
     * @return $this
     */
    public function setArrivalFlightIndex($arrivalFlightIndex)
    {
        $this->container['arrivalFlightIndex'] = $arrivalFlightIndex;

        return $this;
    }

    /**
     * Returns true if offset exists. False otherwise.
     *
     * @param int $offset Offset
     * @return bool
     */
    public function offsetExists($offset)
    {
        return isset($this->container[$offset]);
    }

    /**
     * Gets offset.
     *
     * @param int $offset Offset
     */
    public function offsetGet($offset)
    {
        return $this->container[$offset] ?? null;
    }

    /**
     * Sets value based on offset.
     *
     * @param int $offset Offset
     * @param mixed   $value  Value to be set
     * @return void
     */
    public function offsetSet($offset, $value)
    {
        if (is_null($offset)) {
            $this->container[] = $value;
        } else {
            $this->container[$offset] = $value;
        }
    }

    /**
     * Unsets offset.
     *
     * @param int $offset Offset
     * @return void
     */
    public function offsetUnset($offset)
    {
        unset($this->container[$offset]);
    }
}
